const MonthCard = ({ month, sum18, sum19 }) => {
    return (
        <div className="month-card">
                        <div className="month-name">
                        {month}
                        </div>
                        <div className="month-change">
                        { Math.round( (((sum19) - (sum18)) / (sum18))*10000)/100} %
                        </div>
                      </div>
    )
}

export default MonthCard
